import { Link, NavLink } from 'react-router-dom';
import Account from '../pages/Account';
import homePage from'../pages/HomePage';
const Header = () => {
    return (
        <div className='nav'>
            <span>
                <input type='text' placeholder='Search' className='center'></input>
            </span>
            <span className='navList'>
                <Link to='/HomePage' className='navItem'>Home</Link>
                <Link to='/orders' className='navItem'>Orders</Link>
                <Link to='/' className='navItem'>Shop</Link>
                <p className='navItem'>Help</p>
            </span>
            <span>
                <i></i>
                <Link to='/cart' className='cart'>Your Cart</Link>
            </span>
        </div>

    )
}

export default Header;
